import React from "react";
import "./Byline.scss";

interface BylineProps {
    image: string;
    link: string;
}

const Byline = (BylineProps: BylineProps) => {
    const { image, link } = BylineProps;
    return (
        <div className="Byline">
            <div className="Title">
                <hr />
                <h2>Bylines In</h2>
                <hr />
            </div>
            <a href={link}>
                <img src={require(`../../assets/${image}`)} alt="" />
            </a>
            <hr />
        </div>
    );
};

export default Byline;
